import React from 'react';
export default class FetchData extends React.Component {
    state = {
        loading: true,
        app: null,
    }
    async componentDidMount() {
        const response = await fetch('https://api.npoint.io/54d09df281f91e8c146f')
        const data = await response.json();
        console.log(data)
        var temp = []
        data.forEach(data => {
            temp.push(<h1>{data.publisherName}</h1>)
        })
        this.setState({ loading: false, app: temp })

    }
    render() {
        return (
            <div>

                { this.state.loading || !this.state.app ? <div>Loading</div> : <div>{
                    this.state.app.forEach((element) => {
                        (<div>
                            {element.publisherName}
                        </div>)
                    })
                }</div>}
            </div>
        );
    }
}
